feeds.query:
{
  allMarkdownRemark(
    sort: { order: DESC, fields: [frontmatter___date] },
    filter: {
      frontmatter: { draft: { ne: true } },
      fileAbsolutePath: { regex: "/posts/" }
    },
  ) {
    edges {
      node {
        excerpt
        html
        frontmatter {
          title
          date
        }
        fields {
          slug
        }
      }
    }
  }
}

